/* This code is creating an image sel component using Next.js and React. It imports the `Image`
component from Next.js to display the images and the `Marquee` component from `react-fast-marquee`
to create the scrolling effect. The `images` array contains the image URLs and alt text for each
image. The `Imagesel` function returns a div containing the `Marquee` component with each image
wrapped in a div with the `Image` component inside. It also includes a text overlay using a `p`
element with a gradient background and border. */
import Image from "next/image";
import Marquee from "react-fast-marquee";


const images = [
    {
        src: "https://upload.wikimedia.org/wikipedia/commons/thumb/e/ec/Institute_of_Engineering_and_Management_01.jpg/330px-Institute_of_Engineering_and_Management_01.jpg",
        alt: "image 0",
    },
   
    {
        src: "https://upload.wikimedia.org/wikipedia/commons/thumb/e/ec/Institute_of_Engineering_and_Management_01.jpg/330px-Institute_of_Engineering_and_Management_01.jpg",
        alt: "image 1",
    },
    {
        src: "data:image/jpeg;base64,",
        alt: "image 2",
    },
    {
        src: "https://upload.wikimedia.org/wikipedia/commons/thumb/e/ec/Institute_of_Engineering_and_Management_01.jpg/330px-Institute_of_Engineering_and_Management_01.jpg",
        alt: "image 0",
    },
    {
        src: "https://upload.wikimedia.org/wikipedia/commons/thumb/e/ec/Institute_of_Engineering_and_Management_01.jpg/330px-Institute_of_Engineering_and_Management_01.jpg",
        alt: "image 1",
    },
    {
src: "data:image/jpeg;base64,",
        alt: "image 2",
    },
    {
        src: "https://upload.wikimedia.org/wikipedia/commons/thumb/e/ec/Institute_of_Engineering_and_Management_01.jpg/330px-Institute_of_Engineering_and_Management_01.jpg",
        alt: "image 1",
    },
    {
        src: "https://upload.wikimedia.org/wikipedia/commons/thumb/e/ec/Institute_of_Engineering_and_Management_01.jpg/330px-Institute_of_Engineering_and_Management_01.jpg",
        alt: "image 1",
    },
    {
        src: "https://upload.wikimedia.org/wikipedia/commons/thumb/e/ec/Institute_of_Engineering_and_Management_01.jpg/330px-Institute_of_Engineering_and_Management_01.jpg",
        alt: "image 0",
    },


    {
src: "data:image/jpeg;base64,",
        alt: "image 2",
    },
];


export default function Imagesel({ theme }) {
    return (
        <div>
            <div className="flex w-full relative">
                <Marquee
                    pauseOnHover={true}
                    pauseOnClick={true}
                    loop={0}
                    speed={30}
                    gradient={false}
                    className={'bg-[black] border-x-2 border-b-2 border-main'}
                >
                    {images.map((image) => (
                        <div key={image.alt} className="">
                            <Image
                                src={image.src}
                                alt={image.alt}
                                className="w-[30vw] h-full object-cover border-x-2 border-main"
                                height={1500}
                                width={1500}
                            />
                        </div>
                    ))}
                </Marquee>
                <div className="xl:text-6xl lg:text-5xl md:text-2xl sm:text-md z-10 text-center absolute inset-0 flex justify-start items-center">
                    <p className={`p-8 h-[30vw] w-[25vw] flex justify-center items-center ${theme ? "bg-gradient-to-t from-[#071fb4]" : "bg-gradient-to-t from-[#ffffff]"} to-[#e2a343] ${theme ? "text-dark__blue" : "text-[#04192f]"} border-x-4 border-t-4 border-b-2 ${theme ? "border-dark__blue" : "border-[#04192f]"}`}> Welcome To Coder's Collab Platform</p>
                </div>
            </div>
        </div>
    );
}



